 
-- SQL procedure to define the IKS service datatable  
-- Stephane Erard, LESIA/PADC, Sat Mar 26 09:02:35 2016 (written by IDL routine dbiks.pro)
-- Can be used as a template for other light services 
 
-- DATABASE "IKS", must be created first;       
 
-- Name: iks; Type: SCHEMA; Schema: iks; Owner: postgres

DROP SCHEMA IF EXISTS iks cascade;
-- line above to be commented for tests only
CREATE SCHEMA iks;
SET search_path = public, pg_catalog;

SET default_tablespace = '';

SET default_with_oids = false;

-- Name: data_table; Type: TABLE; Schema: iks; Owner: postgres; Tablespace: 

CREATE TABLE iks.data_table (
    id integer NOT NULL,
    filename 		character varying(12),
    rootname 		character varying(8),
    observation_id character varying(6),
    time_obs 		character varying(23),
    target 		character varying(6),
    distance 		float,
    Sdistance 		float,
    Edistance 		float,
    sp_min 		float,
    sp_max 		float,
    sp_step_min 	float,
    sp_step_max 	float,
    sp_res_min 	float,
    sp_res_max 	float,
    exp_time 		float,
    phase_ang 		float,
    inst_name 		character varying(3),
    inst_host_name character varying(6),
    ref 			character varying(60),
    a_url 			character varying(94),
    a_format 		character varying(7),
    o_url 			character varying(94),
    o_format 		character varying(5)
);
 
 
ALTER TABLE ONLY iks.data_table
        ADD CONSTRAINT data_table_pkey PRIMARY KEY (id);

-- Set access/ownership of schema and table  
REVOKE ALL ON SCHEMA "iks" FROM PUBLIC;  
REVOKE ALL ON SCHEMA "iks" FROM postgres;  
GRANT ALL ON SCHEMA "iks" TO postgres;  
GRANT ALL PRIVILEGES ON SCHEMA iks TO gavo WITH GRANT OPTION; 
GRANT ALL PRIVILEGES ON SCHEMA iks TO gavoadmin WITH GRANT OPTION; 
GRANT ALL PRIVILEGES ON iks.data_table TO gavo WITH GRANT OPTION; 
GRANT ALL PRIVILEGES ON iks.data_table TO gavoadmin WITH GRANT OPTION; 
 
